<template>
    <div class="room">
        <div class="video-box" ref="video-box">
            <video class="video-mine" autoplay controls ref="video-mine"></video>
        </div>

        <!--画板 start-->
        <div class="demo">
            <div class="rtcBox">
                <ul>
                    <li v-for="v in handleList" :key="v.type">
                        <el-color-picker v-model="color" show-alpha v-if="v.type === 'color'" @change="colorChange"
                                         :disabled="allowHangup"></el-color-picker>
                        <button :disabled="v.type === 'cancel' ? allowHangup || allowCancel:
                            v.type === 'go' ? allowHangup || allowGo
                            :allowHangup"
                                @click="handleClick(v)"
                                v-if="!['color', 'lineWidth', 'polygon'].includes(v.type)"
                                :class="{active: currHandle === v.type}"
                        >
                            {{v.name}}
                        </button>
                        <el-popover
                                placement="top"
                                width="400"
                                trigger="click"
                                v-if="v.type === 'polygon'"
                        >
                            <el-input-number v-model="sides" controls-position="right" @change="sidesChange" :min="3"
                                             :max="10"></el-input-number>
                            <button slot="reference" :disabled="allowHangup" @click="handleClick(v)"
                                    :class="{active: currHandle === v.type}">{{v.name}}
                            </button>
                        </el-popover>
                        <el-popover
                                placement="top"
                                width="400"
                                trigger="click"
                                v-if="v.type === 'lineWidth'"
                        >
                            <el-slider v-model="lineWidth" :max=20 @change="lineWidthChange"></el-slider>
                            <button slot="reference" :disabled="allowHangup">{{v.name}} <i>{{lineWidth + 'px'}}</i>
                            </button>
                        </el-popover>
                    </li>
                </ul>
                <div>
                    <canvas width="400" height="300" ref="canvas" id="my-canvas"></canvas>
                    <img src="data:image/png;base64,"
                         alt="from canvas">
                    <button v-on:click="saveImageInfo">save</button>
                    <h5>白板操作</h5>
                </div>
                <!--<div>-->
                <!--<canvas width="400" height="300" ref="canvas2" id="myCanvas"></canvas>-->
                <!--<h5>白板操作</h5>-->
                <!--</div>-->
                <div>
                    <video src="" id="rtcB-Board" playsinline autoplay></video>
                    <h5>演示画面</h5>
                    <button @click="call2" :disabled="allowCall">call</button>
                    <button @click="hangup2" :disabled="allowHangup">hangup</button>
                </div>
            </div>
            <div>
                <h5>聊天</h5>
                <div class="chat">
                    <div class="message" v-for="(v, i) in messageList" :key="i">
                        <p>
                            {{v.account}} - {{v.time}}
                        </p>
                        <p class="mes">{{v.mes}}</p>
                    </div>
                </div>
                <textarea v-model="sendText"></textarea> <br>
                <button :disabled="!isToPeer" @click="sendMsg(['text'])">发送</button>
            </div>
        </div>
        <!--画板 end-->
    </div>
</template>

<script>
    import socket from '../../utils/socket';
    import {Palette} from '../../utils/palette';

    export default {
        name: 'home',
        data() {
            return {
                // 画板start
                // 画板预设数据
                canvas: null,
                context: null,
                peerA: null,
                peerB: null,
                offerOption2: {
                    offerToReceiveAudio: 1,
                    offerToReceiveVideo: 1
                },
                allowCall: true,
                allowHangup: true,
                handleList: [
                    {name: '圆', type: 'arc'},
                    {name: '线条', type: 'line'},
                    {name: '矩形', type: 'rect'},
                    {name: '多边形', type: 'polygon'},
                    {name: '橡皮擦', type: 'eraser'},
                    {name: '撤回', type: 'cancel'},
                    {name: '前进', type: 'go'},
                    {name: '清屏', type: 'clear'},
                    {name: '线宽', type: 'lineWidth'},
                    {name: '颜色', type: 'color'}
                ],
                color: 'rgba(19, 206, 102, 1)',
                currHandle: 'line',
                lineWidth: 5,
                palette: null, // 画板
                allowCancel: true,
                allowGo: true,
                sides: 3,
                boardLocalStream: null,
                // 画板end

                // 聊天框 start
                messageList: [],
                sendText: '',
                isToPeer: false,
                receiverChannel: {},
                // 聊天框 end


                roomid: 'mt',
                peer: null,
                peerList: {},
                channelList: {},
                candidate: null,
                localStream: null
            }
        },
        watch: {
            userList: {
                handler() {
                },
                deep: true
            }
        },
        beforeDestroy() {
            for (let k in this.peerList) {
                this.peerList[k].close();
                this.peerList[k] = null;
            }
        },
        methods: {
            // 保存canvas中的图片
            saveImageInfo() {
                var mycanvas = document.getElementById("my-canvas");
                var image = mycanvas.toDataURL("image/png");
                var w = window.open('about:blank', 'image from canvas');
                w.document.write("<img src='" + image + "' alt='from canvas'/>");
            },
            getUserMedia() {
                //兼容浏览器的getUserMedia写法
                let myVideo = this.$refs['video-mine'];
                let getUserMedia = (navigator.getUserMedia ||
                    navigator.webkitGetUserMedia ||
                    navigator.mozGetUserMedia ||
                    navigator.msGetUserMedia);
                //获取本地的媒体流，并绑定到一个video标签上输出，并且发送这个媒体流给其他客户端
                return new Promise((resolve, reject) => {
                    getUserMedia.call(navigator, {
                        "audio": true,
                        "video": true
                    }, (stream) => {
                        //绑定本地媒体流到video标签用于输出
                        myVideo.srcObject = stream;
                        this.localStream = stream;
                        resolve();
                    }, function (error) {
                        reject(error);
                        // console.log(error);
                        //处理媒体流创建失败错误
                    });
                })
            },
            getPeerConnection(v) {
                let videoBox = this.$refs['video-box'];
                let iceServer = {
                    "iceServers": [
                        {
                            "url": "stun:stun.l.google.com:19302"
                        }
                    ]
                };
                //兼容浏览器的PeerConnection写法
                let PeerConnection = (window.RTCPeerConnection ||
                    window.webkitRTCPeerConnection ||
                    window.mozRTCPeerConnection);
                // 创建
                let peer = new PeerConnection(iceServer);
                //向PeerConnection中加入需要发送的流
                peer.addStream(this.localStream);

                //如果检测到媒体流连接到本地，将其绑定到一个video标签上输出
                peer.onaddstream = function (event) {
                    // console.log('event-stream', event);
                    let videos = document.querySelector('#' + v.account);
                    if (videos) {
                        videos.srcObject = event.stream;
                    } else {
                        let video = document.createElement('video');
                        video.controls = true;
                        video.autoplay = 'autoplay';
                        video.srcObject = event.stream;
                        video.id = v.account;
                        videoBox.append(video);
                    }
                };
                //发送ICE候选到其他客户端
                peer.onicecandidate = (event) => {
                    if (event.candidate) {
                        socket.emit('__ice_candidate', {
                            'candidate': event.candidate,
                            roomid: this.$route.params.roomid,
                            account: v.account
                        });
                    }
                };
                // console.log('v.account', v.account);
                this.peerList[v.account] = peer;

                // 建立DataChannel
                this.createDataChannel(v.account);
                // 必须是这个先后顺序
                this.onDataChannel(v.account); // 接收 DataChannel


                this.initPeer2()


            },
            createOffer(account, peer) {
                //发送offer，发送本地session描述
                peer.createOffer({
                    offerToReceiveAudio: 1,
                    offerToReceiveVideo: 1
                }).then((desc) => {
                    // console.log('send-offer', desc);
                    peer.setLocalDescription(desc, () => {
                        socket.emit('offer', {
                            'sdp': peer.localDescription,
                            roomid: this.$route.params.roomid,
                            account: account
                        });
                    });
                });
            },
            socketInit() {
                socket.on('offer', v => {
                    // console.log('take_offer', this.peerList[v.account]);
                    this.peerList[v.account] && this.peerList[v.account].setRemoteDescription(v.sdp, () => {
                        this.peerList[v.account].createAnswer().then((desc) => {
                            // console.log('send-answer', desc);
                            this.peerList[v.account].setLocalDescription(desc, () => {
                                socket.emit('answer', {
                                    'sdp': this.peerList[v.account].localDescription,
                                    roomid: this.$route.params.roomid,
                                    account: v.account
                                });
                            });
                        });
                    }, () => {// console.log(err)
                    });
                });
                socket.on('answer', v => {
                    console.log('take_answer', v.sdp);
                    this.peerList[v.account] && this.peerList[v.account].setRemoteDescription(v.sdp, function () {
                    }, () => {// console.log(err)
                    });
                });
                socket.on('__ice_candidate', v => {
                    // console.log('take_candidate', v.candidate);
                    //如果是一个ICE的候选，则将其加入到PeerConnection中
                    if (v.candidate) {
                        this.peerList[v.account] && this.peerList[v.account].addIceCandidate(v.candidate).catch(() => {
                            }// console.log('err', e)
                        );
                    }
                });
                socket.on('disconnected', id => {
                    console.log('disconnected======', id);
                    let dom = document.querySelector('#' + id);
                    if (dom) {
                        dom.remove();
                    }
                });

                // data.account, data.msg_time,
                //     data.msg, data.type
                // users[data.roomid], data.account, data.time2,
                //     data.mes2, data.type,sock.id
                socket.on('test', (observers, account, msg_time, msg, type) => {
                    console.log('manychat start')
                    let params = {
                        account: account,
                        time: msg_time,
                        // time: this.formatTime(new Date()),
                        mes: msg,
                        type: type,
                    };
                    console.log(params)
                    this.messageList.push(params);
                    console.log(this.messageList)
                    console.log('manychat end')
                });
            },

            // 画板 start
            initPalette() {


                // this.palette = new Palette(this.canvas, {
                //     paint: this.context,
                //     imgDataInit: imgData,
                //     drawColor: this.color,
                //     drawType: this.currHandle,
                //     lineWidth: this.lineWidth,
                //     allowCallback: this.allowCallback
                // });

                if (this.palette == null) {
                    var imgData = this.context.getImageData(0, 0, this.canvas.width, this.canvas.height)
                    this.palette = new Palette(this.canvas, {
                        paint: this.context,
                        imgDataInit: imgData,
                        drawColor: this.color,
                        drawType: this.currHandle,
                        lineWidth: this.lineWidth,
                        allowCallback: this.allowCallback,
                        moveCallback: this.moveCallback,
                    });
                }
            },
            moveCallback(...arr) { // 同步到对方
                // console.log('moveCallback', arr);
                this.send(arr);
            },
            allowCallback(cancel, go) {
                console.log('cancle=' + cancel)
                this.allowCancel = !cancel;
                this.allowGo = !go;
            },
            send(arr) { // 发送消息
                console.log('send ==========' + this.channelList)
                for (let channelKey in this.channelList) {
                    let channel = this.channelList[channelKey]
                    console.log(channel)
                    console.log('channel b = ' + channel.readyState)
                    console.log('channel f = ' + channel.readyState)
                    if (arr[0] === 'text') {
                        let params = {
                            account: this.account,
                            time: this.formatTime(new Date()),
                            mes: this.sendText + '-------cg',
                            type: 'text'
                        };
                        channel.send(JSON.stringify(params));
                        this.messageList.push(params);
                        this.sendText = '';
                    } else {
                        if (channel.readyState == 'open') {
                            // 画板信息，是这里传输的吗？是
                            console.log('send', arr);
                            channel.send(JSON.stringify(arr));
                        }
                    }
                }
            },
            sidesChange() {
                this.palette.changeWay({sides: this.sides});
            }
            ,
            colorChange() {
                this.palette.changeWay({color: this.color});
            }
            ,
            lineWidthChange() {
                this.palette.changeWay({lineWidth: this.lineWidth});
            }
            ,
            handleClick(v) {
                if (['cancel', 'go', 'clear'].includes(v.type)) {
                    this.palette[v.type]();
                    return;
                }
                this.palette.changeWay({type: v.type});
                if (['color', 'lineWidth'].includes(v.type)) return;
                this.currHandle = v.type;
            }
            ,
            start() {
                this.state = '2';
                this.newRecognition.start();
            }
            ,
            stop() {
                this.state = '1';
                this.newRecognition.stop();
            }
            ,
            async call2() {

                // this.allowCall = true;
                // this.allowHangup = false;
                // return
                //
                // if (!this.peerA || !this.peerB) { // 判断是否有对应实例，没有就重新创建
                //     this.initPeer2();
                // }
                try {
                    let offer = await this.peerB.createOffer(this.offerOption2); // 创建 offer
                    await this.onCreateOffer(offer);
                } catch (e) {
                    console.log('createOffer: ', e);
                }

                this.allowCall = true;
                this.allowHangup = false;
            }
            ,
            hangup2() {
                this.peerA.close();
                this.peerB.close();
                this.peerA = null;
                this.peerB = null;
                this.allowCall = false;
                this.allowHangup = true;
                this.palette.destroy();
                this.palette = null;
            }
            ,
            async onCreateOffer(desc) {
                try {
                    await this.peerB.setLocalDescription(desc); // 呼叫端设置本地 offer 描述
                } catch (e) {
                    console.log('Offer-setLocalDescription: ', e);
                }
                try {
                    await this.peerA.setRemoteDescription(desc); // 接收端设置远程 offer 描述
                } catch (e) {
                    console.log('Offer-setRemoteDescription: ', e);
                }
                try {
                    let answer = await this.peerA.createAnswer(); // 接收端创建 answer
                    await this.onCreateAnswer(answer);
                } catch (e) {
                    console.log('createAnswer: ', e);
                }
            }
            ,
            async onCreateAnswer(desc) {
                try {
                    await this.peerA.setLocalDescription(desc); // 接收端设置本地 answer 描述
                } catch (e) {
                    console.log('answer-setLocalDescription: ', e);
                }
                try {
                    await this.peerB.setRemoteDescription(desc); // 呼叫端设置远程 answer 描述
                } catch (e) {
                    console.log('answer-setRemoteDescription: ', e);
                }
            }
            ,
            initPeer2() {
                // 创建输出端 PeerConnection
                let PeerConnection = window.RTCPeerConnection || window.mozRTCPeerConnection || window.webkitRTCPeerConnection;
                this.peerA = new PeerConnection();
                this.peerA.addStream(this.boardLocalStream); // 添加本地流
                // 监听 A 的ICE候选信息
                // 如果收集到，就添加给 B
                this.peerA.onicecandidate = (event) => {
                    if (event.candidate) {
                        this.peerB.addIceCandidate(event.candidate);
                    }
                };
                // 创建呼叫端
                this.peerB = new PeerConnection();
                this.peerB.onaddstream = (event) => { // 监听是否有媒体流接入，如果有就赋值给 rtcB 的 src
//                    console.log('event-stream', event.stream);
                    let video = document.querySelector('#rtcB-Board');
                    video.srcObject = event.stream;
                    // this.initPalette(); // 初始化画板
                };
                this.allowCall = false
                this.initPalette(); // 初始化画板
                // 监听 B 的ICE候选信息
                // 如果收集到，就添加给 A
                this.peerB.onicecandidate = (event) => {
                    if (event.candidate) {
                        this.peerA.addIceCandidate(event.candidate);
                    }
                };
                this.allowCall = false;
            }
            ,
            async createMedia2() {
                // 保存本地流到全局
                this.boardLocalStream = this.$refs['canvas'].captureStream();
                this.initPeer2(); // 获取到媒体流后，调用函数初始化 RTCPeerConnection
            }
            ,
            createDataChannel(account) { // 创建 DataChannel
                try {
                    let channel = this.peerList[account].createDataChannel('messagechannel');
                    this.channelList[account] = channel
                    this.handleChannel(channel);
                } catch (e) {
                    console.log('createDataChannel:', e);
                }
            }
            ,
            // remote
            onDataChannel(account) { // 接收 DataChannel
                this.peerList[account].ondatachannel = (event) => {
                    // console.log('ondatachannel', event);
                    this.receiverChannel = event.channel
                    this.channel = event.channel;
                    this.handleChannel(this.channel);
                };
            },
            // 判断对象是否相等
            isObjectValueEqual(a, b) {
                var aProps = Object.getOwnPropertyNames(a);
                var bProps = Object.getOwnPropertyNames(b);
                if (aProps.length != bProps.length) {
                    return false;
                }
                for (var i = 0; i < aProps.length; i++) {
                    var propName = aProps[i]

                    var propA = a[propName]
                    var propB = b[propName]
                    if ((typeof (propA) === 'object')) {
                        if (this.isObjectValueEqual(propA, propB)) {
                            // return true     这里不能return ,后面的对象还没判断
                        } else {
                            return false
                        }
                    } else if (propA !== propB) {
                        return false
                    } else {

                    }
                }
                return true
            },


            handleChannel(channel) { // 处理 channel
                channel.binaryType = 'arraybuffer';
                channel.onopen = (event) => { // 连接成功
                    console.log('channel onopen', event);
                    this.isToPeer = true; // 连接成功
                    this.loading = false;
                    this.initPalette();     // 在这里传输画板信息吗？
                };
                channel.onclose = function (event) { // 连接关闭
                    console.log('channel onclose', event)
                };
                channel.onmessage = (e) => { // 收到消息
                    if (Array.isArray(JSON.parse(e.data))) {
                        let [type, ...arr] = JSON.parse(e.data);
                        // console.log('onmessage', type, arr);
                        this.palette[type](...arr);
                    } else {
                        let msg = JSON.parse(e.data)
                        this.messageList.push(msg);
                    }
                    console.log('channel onmessage', e.data);
                };
            },
            formatTime(date) {
                const hour = date.getHours();
                const minute = date.getMinutes();
                const second = date.getSeconds();
                return [hour, minute, second].map(this.formatNumber).join(':');
            },
            formatNumber(n) {
                n = n.toString();
                return n[1] ? n : '0' + n;
            },

            sendMsg(arr) { // 本地发送消息
                let params = {
                    roomid: this.roomid,
                    account: this.account,
                    time2: this.formatTime(new Date()),
                    mes2: this.sendText,
                    type: 'text'
                };
                console.log('发送----------start')
                console.log(params)
                console.log('发送----------end')
                socket.emit('manychat', params);

            },
            // 画板 end
            // 画圆
            drawCircle() {

                var c = document.getElementById("myCanvas");
                var ctx = c.getContext("2d");
                ctx.beginPath();
                ctx.arc(95, 50, 40, 0, 2 * Math.PI);
                ctx.stroke();
            },
        },
        mounted() {
            this.$nextTick(() => {
                // 载入图片数据到canvas中
                this.canvas = document.getElementById('my-canvas');
                this.context = this.canvas.getContext('2d');
                console.log('this.context start')
                console.log(this.context)
                console.log('this.context end')
                var img = new Image();
                let context = this.context
                let canvas = this.canvas
                img.onload = function () {
                    context.drawImage(this, 0, 0, canvas.width, canvas.height);
                }
                img.src="data:image/jpg;base64,"
                this.getUserMedia().then(() => {
                    this.account = this.$route.params.account
                    socket.emit('join', {roomid: this.roomid, account: this.$route.params.account});
                });
                this.socketInit();
                this.boardLocalStream = this.$refs['canvas'].captureStream();
                socket.on('joined', (data, account) => {
                    console.log('joined', data);

                    if (data.length > 1) {
                        data.forEach(v => {
                            let obj = {};
                            let arr = [v.account, this.$route.params.account];
                            obj.account = arr.sort().join('-');
                            if (!this.peerList[obj.account] && v.account !== this.$route.params.account) {
                                // console.log('obj', obj);
                                this.getPeerConnection(obj);
                            }

                        });
                        if (account === this.$route.params.account) {
                            // console.log('account', account);
                            for (let k in this.peerList) {
                                this.createOffer(k, this.peerList[k]);
                            }
                        }
                    }


                });
            });

            // this.drawCircle()
        },
        created() {
        }
    }
    ;
</script>

